int main() {
    int n, m;
    cin >> n >> m;

    vector<int> res(m);
    for (int i = 0; i < m; i++) {
        res[i] = 0;
    }

    for (int i = 0; i < n; i++) {
        string st;
        cin >> st;

        if (st.find('1') == string::npos) {
            cout << -1 << endl;
            return 0;
        }

        vector<int> cur(3 * m);
        vector<int> curAns(m);

        for (int j = 0; j < 3 * m; j++) {
            cur[j] = st[j % m] - '0';
        }

        int counter = 0;
        for (int a = m - 1; a >= 0; a--) {
            if (cur[a] == 1) {
                curAns[a] = 0;
                counter = 0;
            } else {
                counter++;
                curAns[a] = min(counter, curAns[a]);
            }
        }

        for (int j = 0; j < m; j++) {
            res[j] += curAns[j];
        }
    }

    int min = INT_MAX;
    for (int i = 0; i < m; i++) {
        min = min(min, res[i]);
    }

    cout << min << endl;
    return 0;
}
