#include <iostream>
#include <vector>
#include <algorithm>

int main() {
    int A, B;
    std::cin >> A >> B;

    long long ans = -0x7fffffff;
    int bxb, bex, bob, bpb;

    for (int xb = 2; xb <= std::min(B, A + 1)); ++xb) {
        int ob = xb - 1;
        long long score = ob - 1;
        score += (A - (ob - 1))) * (A - (ob - 1)));
        long long pb = B / xb;
        long long ex = B % xb;
        score -= (xb - ex) * pb * pb;
        score -= ex * (pb + 1) * (pb + 1));
        if (score > ans) {
            ans = score;
            bxb = xb;
            bex = ex;
            bob = ob;
            bpb = pb;
        }
    }
    std::cout << ans << std::endl;
    for (int i = 0; i < bxb; ++i) {
        for (int j = 0; j < bpb; ++j) {
            std::cout << "x";
        }
        if (i < bex) {
            std::cout << "x";
        }
        if (i == 0) {
            for (int j = 0; j < A - (bob - 1)); ++j) {
                std::cout << "o";
            }
        }
    }
    std::cout << std::endl;
    return 0;
}
