    for (i = 1; i <= 8; i++) {
        if (str[0].size() == n) {
            ck = 1;
            for (j = 0; j < n; j++) {
                if (islower(str[0][j]])) {
                    if (str[0][j]]!= str[i][j]]) {
                        ck = 0;
